import React from 'react';
import Work from './work';
import { Container, Row, Col, Image } from 'react-bootstrap';

const myWork = () => {
    return (
        <Container style={{ padding: '100px' }} fluid>
            <h5 style={{ textAlign: 'center', paddingBottom: '60px' }}>
                FEATURED PROJECT
            </h5>
            <Row style={{ paddingBottom: '40px' }}>
                <Col xs={12} md={6}>
                    <Work
                        workDetail={{
                            title: 'Shopping Manager',
                            imageUrl:
                                'https://i.ibb.co/dKgFCxg/Screenshot-from-2020-06-25-22-38-03.png',
                            projectDescription:
                                'Web design blog focused on helping beginners with tutorials, videos, code snippets and freebies.',
                            projectUrl: '',
                        }}
                    />
                </Col>
                <Col xs={12} md={2}>
                    <h3
                        style={{
                            color: '#191a1d',
                            fontWeight: '400',
                            fontSize: '60px',
                        }}
                    >
                        {' '}
                        Trelleo
                    </h3>
                    <p
                        style={{
                            color: '#5E5E5E',
                            fontWeight: '300',
                            fontSize: '30px',
                            width: '600px',
                            lineHeight: '40px',
                            paddingTop: '50px',
                        }}
                    >
                        A web site build to help people with shopping Lists,
                        User authentication with Firebase, and styling using MDB
                        library
                    </p>
                </Col>
            </Row>
            <Row>
                <Col xs={12} md={6}>
                    <Work
                        workDetail={{
                            title: 'Shopping Manager',
                            imageUrl:
                                'https://i.ibb.co/dKgFCxg/Screenshot-from-2020-06-25-22-38-03.png',
                            projectDescription:
                                'Web design blog focused on helping beginners with tutorials, videos, code snippets and freebies.',
                            projectUrl: '',
                        }}
                    />
                </Col>
                <Col>
                    <h3
                        style={{
                            color: '#191a1d',
                            fontWeight: '400',
                            fontSize: '60px',
                        }}
                    >
                        {' '}
                        Trelleo
                    </h3>
                    <p
                        style={{
                            color: '#5E5E5E',
                            fontWeight: '300',
                            fontSize: '30px',
                            width: '600px',
                            lineHeight: '40px',
                            paddingTop: '50px',
                        }}
                    >
                        A web site build to help people with shopping Lists,
                        User authentication with Firebase, and styling using MDB
                        library
                    </p>
                </Col>
            </Row>
        </Container>
    );
};

export default myWork;
